import React, { Component } from 'react'

export class Game extends Component {
    constructor(props) {
        super(props)

        this.state = {
            speed: 0,
            level:1
        }
    }

    render() {
        const { correctWordList, wrongWordList } = this.props
        var nextLevel = this.state.level + 1
        return (
            <div>
                {correctWordList}
                {wrongWordList}
            </div>
        )
    }
}

export default Game
